import { format } from "date-fns";
import { ColumnFilter } from "./columnFilter";
import { Link } from "react-router-dom";

export const COLUMNS = [
  {
    Header: "Id",
    Footer: "Id",
    accessor: "_id",
    disableFilters: true,
  },
  {
    Header: "Name",
    Footer: "Name",
    accessor: "name",
    Cell: (props) => <Link to={`/centers/${props.value}`}>{props.value}</Link>,
  },
  {
    Header: "Location",
    Footer: "Location",
    accessor: "location",
  },
  {
    Header: "Address",
    Footer: "Address",
    accessor: "address",
  },
  {
    Header: "Rating",
    Footer: "Rating",
    accessor: "rating",
  },
];
